import React from 'react';
import './NotFound.css';
import Frame from ' .'

function NotFound() {
  return (
    <div className="macbook-img">
      <img className="ellipse" width="289px" height="289px" src="/img/Frame 14.svg" alt="ellipse" />
      <img className="camera" width="5px" height="5px" src="/img/camera.svg" alt="camera" />
      <img className="macbook-imgs" src="/img/Rectangle 1 copy 4.svg" alt="macbook background" />
      <img className="artwork" width="730px" height="470px" src="/img/PUT ARTWORK HERE.svg" alt="artwork" />
      <img className="shape" width="890px" height="17px" src="/img/Shape 3 copy 2.svg" alt="shape" />
      <img className="shape-2" width="945px" height="7.5px" src="/img/Shape 2 copy 2.svg" alt="shape-2" />
      <img className="touchpad" width="135px" height="4.75px" src="/img/touchpad.svg" alt="touchpad" />
      <img className="frame" width="150px" height="200px" src="/img/Frame 33.svg" alt="frame" />
    </div>
  );
}

export default NotFound;
